import { Container, Row, Col } from 'react-grid-system';


export default () => {
    return <div>
        <style global jsx>{`
        body {
          margin: 0;
          padding: 0;
          background: #FCF9E9;
          -moz-osx-font-smoothing: grayscale;
          -webkit-font-smoothing: antialiased;
          -webkit-backface-visibility: hidden;
          font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
        }
        a{
            color: black;
        }
        .menu_items a{
            margin-left: 13px;
        }
        p{
            font-size: 18px;
            line-height: 24px;
        }
      `}</style>
        <div style={{ height: 70 }}>
            <Container>
                <Row>
                    <Col md={6} style={{ lineHeight: "70px" }}><img src="/logo.svg" /></Col>
                    <Col className="menu_items" md={6} style={{ textAlign: "right", lineHeight: "70px" }}>
                        <a href="#">Terms of use</a>
                        <a href="#">About us</a>
                        <a href="#">Feedback</a>
                    </Col>
                </Row>
            </Container>
            <Container>
                <h1>The human consequences</h1>
                <p>we have seen the significant economic impact of the coronavirus on financial markets and vulnerable industries such as manufacturing, tourism, hospitality and travel.</p>
                <p>This, in turn, affects many people, typically the least well-paid and those self-employed or working in informal environments.</p>
            </Container>
        </div>
    </div>
}
